import React from "react";
import "./style.css";

const About = () => {
    return (
        <div className="mainText">
           <h1>This is about page</h1> 
           <div className="infoTextDiv">
           <p className="infoText">I am a 21 year old student. I study at
            the University of Business and Technology, Faculty 
           of Information Technology. I am currently in my third year.
            </p>
           </div>
        </div>
    )
}
export default About;
